import React from 'react';
import '../Styles/Navbar.css';
import '../Styles/Utility.css';
import AppLogo from '../Images/app-logo.png';

const Navbar = (props) => {
  return (
    <header className='navbar'>
        <a href='#' className='navbar_logo'>
          <img src={AppLogo} alt="Logo" />
        </a>
        <nav>
          <ul className='navbar_menu'>
            <li>
              <a className='navbar_links' href="">Home</a>
            </li>
            <li>
              <a className='navbar_links' href="">Completed</a>
            </li>
            <li>
              <a className='navbar_links' href="">Upcoming</a>
            </li>
            <li>
              <button className='navbar_btn' type="button" onClick={props.toggleTheme}>
                
              </button>
            </li>
          </ul>
        </nav>
    </header>
  );
};

export default Navbar;
